import React from 'react'
import './WhyChooseUs.css'
import WhyChooseUsColumn from './WhyChooseUsColumn'
import { whyChooseUs } from 'data/WhyChooseUsData'


const WhyChooseUs = () => {
    return (
        <div className="content" id="whyChooseUs">
            <div className="why-choose-us-container">
                <div className="why-choose-use-row">
                    
                    {whyChooseUs.map(wcu =>{
                        {<WhyChooseUsColumn wcuTitle="Hello World" wcuDescription="Building architectures with modern technology." wcuReadMore="google.com"/>}
                    })}
                </div>
            </div>
        </div>
    )
}

export default WhyChooseUs
